<html>
<head>
<title>Lead On! 2022 Brochure</title>
<link href="https://cdn.jsdelivr.net/npm/bootstrap@5.2.2/dist/css/bootstrap.min.css" rel="stylesheet" integrity="sha384-Zenh87qX5JnK2Jl0vWa8Ck2rdkQ2Bzep5IDxbcnCeuOxjzrPF/et3URy9Bv1WTRi" crossorigin="anonymous">
<script src="https://cdn.jsdelivr.net/npm/bootstrap@5.2.2/dist/js/bootstrap.bundle.min.js" integrity="sha384-OERcA2EqjJCMA+/3y+gxIOqMEjwtxJY7qPCqsdltbNJuaOe923+mo//f6V8Qbsw3" crossorigin="anonymous"></script>
</head>
<body>
<div id="carouselExampleIndicators" class="carousel slide" data-bs-ride="true">
  <div class="carousel-indicators">
    <button type="button" data-bs-target="#carouselExampleIndicators" data-bs-slide-to="0" class="active" aria-current="true" aria-label="Slide 1"></button>
    <button type="button" data-bs-target="#carouselExampleIndicators" data-bs-slide-to="1" aria-label="Slide 2"></button>
    <button type="button" data-bs-target="#carouselExampleIndicators" data-bs-slide-to="2" aria-label="Slide 3"></button>
  </div>
  <div class="carousel-inner">
    <div class="carousel-item active">
      <img src="https://namya0303.github.io/leadon/1.jpg" class="d-block w-50" alt="Brochure pg. 1">
    </div>
    <div class="carousel-item">
      <img src="https://namya0303.github.io/leadon/2.jpg" class="d-block w-50" alt="Brochure pg. 2">
    </div>
    <div class="carousel-item">
      <img src="https://namya0303.github.io/leadon/3.jpg" class="d-block w-50" alt="Brochure pg. 3">
    </div>
    <div class="carousel-item">
      <img src="https://namya0303.github.io/leadon/4.jpg" class="d-block w-50" alt="Brochure pg. 4">
    </div>
    <div class="carousel-item">
      <img src="https://namya0303.github.io/leadon/5.jpg" class="d-block w-50" alt="Brochure pg. 5">
    </div>
    <div class="carousel-item">
      <img src="https://namya0303.github.io/leadon/6.jpg" class="d-block w-50" alt="Brochure pg. 6">
    </div>
  </div>
  <button class="carousel-control-prev" type="button" data-bs-target="#carouselExampleIndicators" data-bs-slide="prev">
    <span class="carousel-control-prev-icon" aria-hidden="true"></span>
    <span class="visually-hidden">Previous</span>
  </button>
  <button class="carousel-control-next" type="button" data-bs-target="#carouselExampleIndicators" data-bs-slide="next">
    <span class="carousel-control-next-icon" aria-hidden="true"></span>
    <span class="visually-hidden">Next</span>
  </button>
</div>
</body>
</html>
